WILLEMSTAD — Preparashon nan ta kontinuá pa e 2 enkuentronan di nos selekshon nashonal ku lo enfrentá e selekshon di Bolivia durante 2 wega amistoso ku lo tuma lugá dianan 23 i 26 di mart próksimo den Stadion Ergilio Hato pa 8’or di anochi. Awe den oranan di atardi nos hungadónan residensiá den eksterior a pisa suela di Kòrsou pa asina djòin nos hugandónan lokal pa kontinuá ku e training i preparashon nan pa loke ta trata e 2 kompromisonan di djabièrnè i djaluna próksimo. Nos kontrinkante, e sel
